        <style>
            *{
                margin:0;
                padding: 0;
                border: 0;
                box-sizing: border-box;
                font-family: 'Saira'
            }
            section{
                height: 100vh;
                width: 100vw;
                background: #dc4a4d;
                display: flex;
                flex-flow: row wrap;
                overflow: hidden;
                padding: 5%;
                color: #fff;
            }
            .col-1{
                /*background: green;*/
                width: 40%;
                height: 100%;
                padding: 5%;
                display: flex;
                flex-flow: column wrap;
                align-items: center;
                justify-content: center;
                overflow: hidden;
            }
            .col-2{
                /*background: yellow;*/
                width: 60%;
                height: 100%;
                padding: 5%;
                display: flex;
                flex-flow: column wrap;
                align-items: center;
                justify-content: center;
                overflow: hidden;
            }
            .col-2 h1{
                font-size: 20em;
                line-height: 250px;
                font-weight: bolder;
                padding: 5%;
                text-shadow: 0px -1px 0px rgba(0,0,0,0.4);
            }
            .col-2 p{
                font-size: 1em;
            }
            ul{
                list-style: none;
                display: flex;
            }
            li{
                padding: 10px;
            }
            a{
                text-decoration: none;
                border: none;
                color: #fff;
                border-bottom: 5px;
                transition: all .5s ease;
            }
            a:hover{
                border-bottom: 1px solid #ddff2b;
                color: #ddff2b;
            }
            @media screen and (max-width: 480px){
                section{
                    flex-flow: column wrap;
                    height: auto;
                }
                .col-2{
                    width: 100%;
                    height: auto;
                    order: 1;
                }
                .col-1{
                    width: 100%;
                    order: 2;
                }
                .col-2 h1{
                    font-size: 8em;
                    line-height: normal;
                    padding: 0;
                }
                .col-2 p{
                    text-align: justify;
                }
            }
            @media screen and (min-width: 481px) and (max-width: 599px){
                .col-1{
                    width: 30%;
                }
                .col-2{
                    width: 70%;
                    justify-content: center;
                    align-items: center;
                    padding: 2%;
                }
                .col-2 h1{
                    font-size: 5em;
                    line-height: normal;
                    padding: 0;
                }
                .col-2 p{
                    text-align: justify;
                    font-size: .6em;
                }
                .col-2 a{
                    font-size: .6em;
                }
                .col-1 img{
                    width: 90%;
                }
            }
            @media screen and (min-width: 600px) and (max-width: 799px){
                section{
                    flex-flow: column wrap;
                }
                .col-2{
                    width: 100%;
                    height: 60%;
                    order: 1;
                }
                .col-1{
                    width: 100%;
                    order: 2;
                    height: 40%;
                }
                .col-2 h1{
                    font-size: 12em;
                    line-height: normal;
                    padding: 0;
                }
                .col-2 p{
                    text-align: justify;
                    font-size: .8em;
                }
                .col-2 a{
                    font-size: .8em;
                }
            }
            @media screen and (min-width: 800px) and (max-width: 1024px){
                .col-1{
                    width: 30%;
                }
                .col-2{
                    width: 70%;
                    justify-content: center;
                    align-items: center;
                    padding: 2%;
                }
                .col-2 h1{
                    font-size: 12em;
                    line-height: normal;
                    padding: 0;
                }
                .col-2 p{
                    text-align: justify;
                    font-size: .6em;
                }
                .col-2 a{
                    font-size: .6em;
                }
                .col-1 img{
                    width: 90%;
                }
            }
            @media screen and (min-width: 1025px) and (max-width: 1366px){}
        </style>
    </head>
